import { ADDTASK, DELETETASK, EDITTASK,  FINISHTASK } from "./actiontype"

export const ADDTODO=(newtodo)=>
{
return {
    type:ADDTASK,
    payload: newtodo
} 

}

export const edittodo=(newedit)=>
{
    return {
        type:EDITTASK,
        payload:newedit
    }

}

export const deletetodo=(newdel)=>
{   
    return {
        type:DELETETASK,
        payload:newdel
    }

}

export const finshtodo=(newfinish)=>
{
    return{
        type:FINISHTASK,
        payload:newfinish
    }
   
}
